            <TeamCard2>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard2>
            <TeamCard2>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard2>
          </Row>
          <Row>
            <TeamCard>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard>
            <TeamCard2>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard2>
            <TeamCard3>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard3>
          </Row>
        </Team>
        </div>
    )
}

export default Equipe
